import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();

    const handleLogin = () => {
        navigate('/login');
    };

    const handleRegister = () => {
        navigate('/register');
    };

    return (
        <div style={styles.container}>
            <h1>Welcome to the Resume Review Platform</h1>
            <p>
                This platform allows students to upload their resumes and get feedback from experts. Experts can register and review the resumes, providing valuable insights and suggestions.
            </p>
            <div>
                <button style={styles.button} onClick={handleLogin}>Login</button>
                <button style={styles.button} onClick={handleRegister}>Sign Up</button>
            </div>
        </div>
    );
};

const styles = {
    container: {
        textAlign: 'center',
        padding: '50px',
    },
    button: {
        margin: '10px',
        padding: '10px 20px',
        fontSize: '16px',
        cursor: 'pointer',
    }
};

export default Home;
